// src/pages/AdminHome.js
import React from 'react';
import withAdminAuth from '../components/withAdminAuth';

const AdminHome = () => (
  <div>
    <h1>Admin Dashboard</h1>
    <p>Welcome to the admin dashboard.</p>
  </div>
);

export default withAdminAuth(AdminHome);
